import React from 'react'
import './App.css';
import img from './Images/1.png'
import img2 from './Images/2.png'
import Images from './components/images/images'
import VerticaMenu from './components/verticalMenu'
import Page1 from './components/page1'
import Page2 from './components/page2'
import Page3 from './components/page3'
import Menu from './components/header/menu';


export default class App extends React.Component  {
    state={
        arr:[
                {min:"236 min",text1:"Graphic design",text2:"30 lessons",img:img,filter:'popular'},
                {min:"134 min",text1:"illustration",text2:"24 lessons",img:img2,filter:'popular'},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"popular"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"popular"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"favorit"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"favorit"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"new"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"popular"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"popular"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"favorit"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"favorit"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"new"},
                {min:"10 min",text1:"text1",text2:"text2",img:"data:image/jpeg;base64,",filter:"new"},
        ],
        filter:'popular',
        contentPage:'',
        status:false
    };
    changePage=(page)=>{
        this.setState({contentPage:page})
    }

    changeFilter=(filter)=>{
        this.setState({ filter })
    }
    filter = (arr,filter) => {
        switch(filter){
            case 'popular':
                return arr.filter((item)=>item.filter === 'popular')
            case 'favorite':
                return arr.filter((item)=>item.filter === 'favorit')
            case 'new':
                return arr.filter((item)=>item.filter === 'new')
            default :
                return arr
        }
    }

    renderMenu = () => {
        const{arr,filter,contentPage}=this.state
        switch (contentPage) {
            case 'page1':
                return <Page1/>
            case 'page2':
                return <Page2/>
            case 'page3':
                return <Page3/>
            default:
                return <Images list={this.filter(arr,filter)}/>
        }
    }

    

    render(){
        return (
            <div className="App">
                <div className='app'>
                    <div className="div1">
                        <VerticaMenu changePage={this.changePage} contentPage={this.state.contentPage} />
                    </div>
                    <div className='div2'>
                        <Menu changeFilter={this.changeFilter} changePage={this.changePage} filter={this.state.filter}/>
                        {this.renderMenu()}
                    </div>
                </div>
            </div>
        );
    }
}